    geo_json_e96c865d044e443696702f06a15ebbbc.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["h3_hex_id", "trip_duration_x"];
    let aliases = ["Hexagon ID:", "Mean of the trip duration in minutes:"];
    let table = '<table>' +
        String(
        fields.map(

        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
